import {useEffect} from 'react';
const Profile = () =>{


    useEffect(() => {
        (
            async() => {
                const response = await fetch("http://localhost:8081/showProfile")
            
                const data = await response.json();
            }

        )();
     
     }, []);
    
    return (

        <div>
            <table className={'form'}>
                <thead>
                    <tr>
                        <th>ID</th>
                        <br/>
                        <th>NAME</th>
                        <br/>
                        <th>CRM</th>
                        <br/>
                        <th>CPF</th>
                        <br/>
                    </tr>
                </thead>
                <tbody>
                <tr>
                        <th>4354354354</th>
                        <br/>
                        <th>fulaninho</th>
                        <br/>
                        <th>1996</th>
                        <br/>
                        <th>9421313313</th>
                        <br/>
                    </tr>
                </tbody>
            </table>
        </div>
    );
     

    
    
}

export default Profile;
